import React from 'react';
import {
    View,Text,StyleSheet
} from 'react-native';
import Quadrado from './quadrado'

export default props => {
    return (
        <View style={style.flex1}>
            <Quadrado cor='#ff808a' />
            <Quadrado cor='#50d1f6' />
            <Quadrado cor='#8312ed' />
        </View>
    )
}
const style = StyleSheet.create({
    flex1:{
        height: 200,
        width: '100%',
        backgroundColor: 'black',
        alignItems: 'center',
        justifyContent: 'space-evenly'
    }
})
